import React from 'react'
import {BiSearchAlt2} from "react-icons/bi";

const _stylesSearch = {
    iconContainerSearch:{
        width:'100%',
        height:'100%',
        display: 'flex',
        flexDirection: 'row',
        justifyContent: 'center',
        alignItems: 'center',
    },
    inputTextSearch:{
        width:'100%',
        padding:'8px',
        borderTopRightRadius:'20px',
        borderBottomRightRadius:'20px',
        borderTopLeftRadius:'20px',
        borderBottomLeftRadius:'20px',
        backgroundColor:'#efefef',
        border: '6px solid #efefef',
        outlineColor:'#84c3fd',
        outlineWidth: '100px',
        paddingLeft: '30px',
    },
    iconLupa:{
        fontSize:'20px',

    }
    };
function PinSearch() {
    return (
        <div style={_stylesSearch.iconContainerSearch}>
                <BiSearchAlt2 style={_stylesSearch.iconLupa}/>
                <input style={_stylesSearch.inputTextSearch} type="text" placeholder="Buscar"/>
        </div>
    )
}

export default PinSearch;
